// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface ENS {
    function setSubnodeRecord(bytes32 node, bytes32 label, address owner, address resolver, uint64 ttl) external;
    function setSubnodeOwner(bytes32 node, bytes32 label, address owner) external returns(bytes32);
}

interface ENSResolver {
    function setAddr(bytes32 node, address a) external;
}

contract ENSHadler {

// 기존 nameHash, label, owner, resolver의 데이터를 이용해서 subonde를 사용할 수 있도록 test해보자 



    bytes32 private _rootNode = 0xfd7f5c28743a891291f9f9971b1e06920f5a26919632c52b05c186bbc4d2fb54;

    function setSubNode(address _resolver, address _ens, address _target, bytes32 _label, bytes32 _subNodeHash) external {
        ENS(_ens).setSubnodeRecord(_rootNode, _label, address(this), _resolver, 0);
        ENSResolver(_resolver).setAddr(_subNodeHash, _target);
        ENS(_ens).setSubnodeOwner(_subNodeHash, _label, _target);
    }
}

